(1, 'Палкин', 'Невский, 50', 'palkin.ru', '+7(812)111-22-33', NULL, NULL, 'resto_logo.svg', '09:00:00', '18:00:00', 'Palkin', NULL, NULL),
(2, 'Токио', 'Бухарестская, 25', 'tokio-city.ru', '+7(912)777-43-23', NULL, NULL, 'resto_logo.svg', NULL, NULL, 'Tokio', 'Токио-Сити – это современные городские рестораны с универсальной кухней. В нашем меню переплетаются элементы японской, итальянской, восточноевропейской, китайской и других кухонь. Меню Токио-Сити насчитывает более 300 блюд и напитков. Эклектичный интерьер ресторана подойдет как для шумных вечеринок в кругу друзей, так и для семейных посиделок. У нас вы можете провести бизнес-ланч или устроить романтический вечер. В Токио-Сити постоянно проходят вечерние мероприятия, DJ-сеты и выступления артистов. Наша сеть насчитывает 40 ресторанов в Санкт-Петербурге и Ленинградской области. Подробная информация с адресами размещена на сайте. Подписывайтесь на нас в социальных сетях, оставляйте отзывы – для нас важна обратная связь, чтобы делать ваш отдых ещё лучше.', 'Tokyo City is a modern city restaurant with a versatile kitchen. In our menu elements of Japanese, Italian, East European, Chinese and other cuisines are intertwined. The menu of Tokyo City has more than 300 dishes and drinks. The eclectic interior of the restaurant is suitable for noisy parties in the circle of friends, and for family gatherings. Here you can have a business lunch or a romantic evening. In Tokyo City, there are always evening events, DJ sets and performances by artists. Our network has 40 restaurants in St. Petersburg and the Leningrad region. Detailed information with addresses is available on the site. Subscribe to us on social networks, leave feedback - feedback is important for us to make your holiday even better.'),
